-- ----------------------------
-- Table structure for flight
-- ----------------------------
DROP TABLE IF EXISTS `flight`;
CREATE TABLE `flight` (
`flight_id`  bigint(20) NOT NULL AUTO_INCREMENT ,
`departure_time`  datetime(6) NOT NULL ,
`aircraft_id`  bigint(20) NOT NULL ,
`departure`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`destination`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`departure_timezone`  varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`version`  int(11) NOT NULL ,
PRIMARY KEY (`flight_id`),
FOREIGN KEY (`destination`) REFERENCES `airport` (`iata_code`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`aircraft_id`) REFERENCES `aircraft` (`aircraft_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`departure`) REFERENCES `airport` (`iata_code`) ON DELETE RESTRICT ON UPDATE RESTRICT,
INDEX `destination` (`destination`) USING BTREE ,
INDEX `aircraft_id` (`aircraft_id`) USING BTREE ,
INDEX `departure` (`departure`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci

;

